// Fügen Sie diesen Code zu Ihrer JavaScript-Datei hinzu oder in ein <script>-Tag am Ende der HTML-Datei
document.addEventListener('DOMContentLoaded', function() {
  // Wenn Alpine.js bereits initialisiert ist
  if (window.Alpine) {
    Alpine.data('mobileMenuController', () => ({
      mobileMenu: false,
      init() {
        this.$watch('mobileMenu', value => {
          if (value) {
            document.body.classList.add('menu-open');
          } else {
            document.body.classList.remove('menu-open');
          }
        });
      }
    }));
  }
});
